import React from 'react'

export const Home = () => {
  return (
    //   home page
    <section>
        {/* details */}
        <div className="">
            <p>So, you want to travel to</p>
            <h1>SPACE</h1>
            <p>Let’s face it; if you want to go to space, you might as well genuinely go to <br />
                outer space and not hover kind of on the edge of it. Well sit back, and relax <br />
                because we’ll give you a truly out of this world experience!</p>
        </div>
        {/* image */}
        <div className="hbg-home-bg-mobile md:bg-home-bg-tablet lg:bg-home-bg-desktop">
            <button>EXPLORE</button>
        </div>
    </section>
  )
}
